class MethodController{


	function displayHeader($id, $header, $lead = null){
		?>
			<div class="blue-bg header">
	   			<h1 id="<?php echo $id; ?>"><?php echo $header; ?></h1>
	   			<?php if($lead != null): ?>
					<p class="lead"><?php echo $lead; ?></p>
				<?php endif; ?>
			</div>
		<?php
	}



